  [],\n\t\"revision_timestamp\": \"2015-05-07T03:51:24.793399\",\n\t\"name\": \"cubesat-ambipolar-thruster-for-leo-and-deep-space-missions-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Aether Industries proposes the development
  of a novel, primary plasma propulsion system that is well suited for small spacecraft.
  This technology, called the CubeSat Ambipolar Thruster (CAT), would provide CubeSats
  and other micro- and nano-satellites with the propulsive capability to make meaningful
  orbital plane and altitude changes &amp;#151; capability that does not currently
  exist with state-of-the-art micropropulsion technologies. As such, the CAT engine
  is an enabling technology that supports NASA, commercial, university, and military
  CubeSat needs from constellation deployment to lunar orbit insertion and beyond.
  In the CAT engine, a high-power  RF plasma discharge is expanded adiabatically along
  a magnetic nozzle topology established by permanent magnets. A resultant ambipolar
  electric field accelerates the ions to high energies to generate thrust while retaining
  high propellant utilization. The CAT engine offers a means of providing efficient
  and high thrust-to-power primary propulsion for CubeSats and microsatellites. The
  CAT engine promises to change the CubeSat paradigm from passive sensor carriers
  to fully capable mission-completing spacecraft. Successful implementation by our
  team will result in the transition of technology developed  into the commercial
  sector by a small business, the engagement of the next generation of the space sector
  workforce, and the infusion of an advanced in-space propulsion technology for future
  NASA, commercial, and government missions.\",\n\t\"license_title\": \"U.S. Government
